import React, { useState } from 'react';
import ReactDOM from 'react-dom';
import Form from './components/Form';
import ExamForm from './components/ExamForm';
import PatientReport from './components/PatientReport';
import './styles.css';
import { BrowserRouter as Router, Route, Switch, Link } from 'react-router-dom';


const App = () => {
  return (
    <Router>
      <div>
        <nav>
          <ul>
            <li>
              <Link to="/patient">Registro de Pacientes</Link>
            </li>
            <li>
              <Link to="/exam">Registro de Exames</Link>
            </li>
          </ul>
        </nav>

        <Switch>
          <Route path="/patient" exact component={PatientRegistration} />
          <Route path="/exam" exact component={ExamRegistration} />
          <Route path="/patient/:numero_atendimento" component={PatientReport} />
        </Switch>
      </div>
    </Router>
  );
};

const PatientRegistration = () => {
  return (
    <div>
      <h1>Registro de Pacientes</h1>
      <Form />
    </div>
  );
};

const ExamRegistration = () => {
  return (
    <div>
      <h1>Registro de Exames</h1>
      <ExamForm />
    </div>
  );
};

ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);
